INSERT INTO `tbl_faq` (`faq_id`, `faq_title`, `faq_content`) VALUES
(6, 'Who are we & What do we do?', '<p>We are your comprehensive solution for all your home design and execution needs.&nbsp;&nbsp;Our offerings encompass personalized, aesthetically pleasing, and functional interior designs for various aspects of your home, including but not limited to modular kitchens,&nbsp;wardrobes, TV units, and more. Our expert Design Consultants are eager to discuss your requirements in detail.</p>'),
(7, 'Already Visualising your Dream Home, Want to know about how to Start?', '<p>Allow us to provide a brief overview of our process:</p><p>     Connect    : Fill in the form for a guaranteed call-back within 24 hours and receive a personalized, cost-free price estimate</p><p>     Deconstruct : We delve into the specifics of your requirements at your convenience. You can explore our offerings further at our Experience Centre.</p><p><span style=\"white-space:pre\">	</span> Design      : Our designers transform your dreams and conversations into a detailed Design Proposal. You can proceed with the project by making                        just a 5% booking payment.</p><p>    Conception  : Our project team initiates work based on the designs you\'ve approved.</p><p><span style=\"white-space:pre\">	</span>Construct    : With tailored designs for your home, we move into the production and execution phase, keeping you informed throughout the process.</p><p><span style=\"white-space:pre\">	</span>Handover    : In just 45 days, your dream home will be ready for you, with the site prepared and installations complete</p><div><br></div><div><br></div><div><br></div>'),
(8, 'What if I already have furniture that I want to use?', '<p>Your existing furniture is indeed valuable to us. Our designers take it into account while crafting your home\'s design. They will also offer guidance on whether it\'s best to retain your current furniture or consider new options, all while maintaining the overall design aesthetics.</p><div><br></div>'),
(9, 'How long does it take from Proposal to Completion?', '<p>Creating your dream home involves a thoughtful process. After finalizing our proposal and booking with a 5% payment, the timeline to completion is as follows:</p><p>&nbsp; &nbsp; a) Design Finalization : Detailed design finalization typically takes around 4 weeks, but we can expedite it based on your preferences and availability.</p><p>&nbsp; &nbsp; b) Execution: We aim to have you settled into your Dream Home within 45 days, as per the agreed design. At Urban Interiors, we ensure that we deliver on&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; our promises, and you won\'t have to wonder, \"What\'s happening?\"</p>'),
(10, 'All thats fine, but what if I dont like the design proposal?', '<p>We have confidence in our expertise and believe you\'ll be delighted with our offerings. However, if you find our designer\'s suggestions not to your liking, simply let us know, and we can part ways amicably, with no hard feelings. Your satisfaction is our priority.</p>');

