(1, 'About Us', '<p style=\"border: 0px solid; margin-top: 1.5rem; margin-bottom: 0px;\"><b><span style=\"font-family: Tahoma;\">Welcome to Dzynbox Project!</span></b></p><p style=\"border: 0px solid; margin-top: 1.5rem; margin-bottom: 0px;\"><span style=\"border: 0px solid; font-family: Tahoma;\"><b>We aim to offer our customers a variety of the latest Products. Welcome&nbsp; a long way, so we know exactly which direction to take when supplying you with high quality yet budget-friendly products. We offer all of this while providing excellent customer service and friendly support.</b></span></p><p style=\"border: 0px solid; margin-top: 1.5rem; margin-bottom: 0px;\"><span style=\"border: 0px solid; font-family: Tahoma;\"><b>We always keep an eye on the latest trends in [PRODUCTS CATEGORY NAME] and put our customer wishes first. That is why we have satisfied customers all over the world, and are thrilled to be a part of the [PRODUCTS CATEGORY NAME] industry.</b></span></p><p style=\"border: 0px solid; margin-top: 1.5rem; margin-bottom: 0px;\"><span style=\"border: 0px solid; font-family: Tahoma;\"><b>The interests of our customers are always top priority for us, so we hope you will enjoy our products as much as we enjoy making them available to you.</b></span></p><p style=\"\"><b><span style=\"font-family: Tahoma;\">We make sure you get the best quality outfits with hassle free returns and exchanges policy. We ensure what you see is exactly what you get!</span></b></p><ul><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>Low Price Guarantee</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>24/7 Customer Support</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>E-Mail - Text - Call</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>We are here for you 24/7 online and via phone.</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>Sizing &amp; Color</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>Worldwide Shipping</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>We love to expand our business Internationally soon.</b></span></font></li><li style=\"text-align: justify;\"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>Easy Returns</b></span></font></li></ul><p style=\"text-align: justify; \"><b><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\">Bought an outfit but want to return it? We have a 3 days easy return policy. Please mail us at support@d</span></font><span style=\"font-family: Tahoma;\">zynbox</span><span style=\"font-size: 14px; font-family: Tahoma;\">.com for more details.</span></b></p><p style=\"text-align: justify; \"><b><br></b></p><p style=\"text-align: justify; \"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>Verified Security</b></span></font></p><p style=\"text-align: justify; \"><font face=\"apercu, Arial, sans-serif\"><span style=\"font-size: 14px; font-family: Tahoma;\"><b>All our transactions are Verified by Norton and with the highest standards of security. Plus, there\'s a lot to go around too through regular exciting offers and gifts, so spread the word and refer us to everyone from your family, friends and colleagues and get rewarded for it. And to top it all, you can share your user experience by posting reviews. Don\'t wait any longer Sign up with us now! start stalking, start buying and start loving and start Introducing the beauty in you.</b></span></font></p>\r\n', 'about-banner.jpg', 'Dzynbox - About Us', 'about, about us, about fashion, about company, about Dzynbox project', 'Our goal has always been to get the best in you we brought a huge collection .', 'FAQ', 'faq-banner.jpg', 'Fashionys.com - FAQ', '', '', 'Blog', 'blog-banner.jpg', 'Ecommerce - Blog', '', '', 'Contact Us', 'contact-banner.jpg', 'Fashionys.com - Contact', '', '', 'Photo Gallery', 'pgallery-banner.jpg', 'Ecommerce - Photo Gallery', '', '', 'Video Gallery', 'vgallery-banner.jpg', 'Ecommerce - Video Gallery', '', '');

